import React from "react";
import { RouteComponentProps } from "react-router-dom";
import {
  GivePage,
  MailPage,
  NotePage,
  OrganizePage,
  ReadPage,
  WritePage,
} from "./ProductPages";
import Note from "./ProductPages/Note";
import Give from "./ProductPages/Give";

interface MatchParams {
  type: string;
}
interface Props extends RouteComponentProps<MatchParams> {}

const Products: React.FC<Props> = ({ match }) => {
  let productType: string = match.params.type;
  switch (productType) {
    case "mail":
      return MailPage;
    case "notes":
      return NotePage;
    case "organize":
      return OrganizePage;
    case "read":
      return ReadPage;
    case "write":
      return WritePage;
    case "give":
      return GivePage;
  }
};

export default Products;
